const EditableMathExample = () => {
  const [latex, setLatex] = useState("\\frac{1}{\\sqrt{2}}\\cdot 2");

  return (
    <div>
      <EditableMathField
        latex={latex}
        onChange={(mathField) => {
          setLatex(mathField.latex());
        }}
      />
      <p>{latex}</p>
    </div>
  );
}; 

const StaticMathExample = () => {
  return <StaticMathField>{"\\frac{1}{\\sqrt{5}}\\cdot 2"}</StaticMathField>;
};

const Appp = () => (
  <div>
    <h2>Editable Math Field</h2>
    <EditableMathExample />
    <br />
    <h2>Static Math Field</h2>
    <StaticMathExample />
  </div>
);

export default Appp;
